import React from "react";
import logo from "../assets/logo.png";
import { Link } from "react-router-dom";
import '../styles/navbar,css';

function navbar() {
    return (
        <div className="navbar">
            <div className="LeftSide">
                <img src={logo} alt=""/>
            </div>
        </div>
    );
}

export default navbar;
